import Grid from "@material-ui/core/Grid";
import Typography from "@material-ui/core/Typography";
import TextField from "@material-ui/core/TextField";

export default function Index() {
  return (
    <Grid
      container
      spacing={2}
      justify="center"
      alignItems="center"
      style={{ padding: 13 }}
    >
      <Grid item xs={7}>
        <Typography variant="h1">Xin Chào,</Typography>
        <Typography variant="h2">
          Bạn đang cần một nhóm để thiết kế website, phần mềm, hay một thứ gì
          khác...?
        </Typography>
        <TextField
          style={{ width: "100%" }}
          label="Mô tả yêu cầu của bạn"
          placeholder="Mô tả yêu cầu của bạn..."
          multiline
        />
      </Grid>
      <Grid item xs={5}>
        <img style={{ width: "100%" }} src="/img/banner.png" />
      </Grid>
    </Grid>
  );
}
